import React, { useEffect, useState } from "react";
import { auth } from "../firebase/firebase"; // Assuming you have a firebase config file
import { useNavigate } from "react-router-dom";

function Home() {
  const navigate = useNavigate();
  const [user, setUser] = useState(null);
  console.log(user)

  useEffect(() => {
    const unsubscribe = auth.onAuthStateChanged((currentUser) => {
      setUser(currentUser);
    });

    return unsubscribe; // Clean up listener on component unmount
  }, []);

  const logout = () => {
    auth.signOut().then(() => {
      localStorage.clear();
      navigate("/");
    });
  };

  return (
    
    <div>
      {user ? (
        
        <h1>
          Hello, {user.displayName || user.email}!
        </h1>
      ) : (
        <h1>
          Please sign in to see your name.
        </h1>
      )}
       <iframe 
  style={{border: "0", width: "100%", height: "270px"}} 
  src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3151.8354345096036!2d144.95373531544364!3d-37.817209979751984!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x6ad642af0f11fd81%3A0x5045675218ce6e41!2sMelbourne%20VIC%2C%20Australia!5e0!3m2!1sen!2sau!4v1637913126650!5m2!1sen!2sau" 
  frameBorder="0" 
  allowFullScreen
></iframe>
      <button onClick={logout}>Logout</button>
    </div>
  );
}

export default Home;
